script: |
  super -f text -I q5784.spq | sort > q5784.out

inputs:
  - name: q5784.spq
    data: |
      SELECT 50 * + col1 FROM tab1 (FORMAT parquet) WHERE NOT ( + col1 + + 50 + + ( col0 ) ) BETWEEN ( col1 * + col0 ) AND + 99;
  - name: tab1

outputs:
  - name: q5784.out
    data: |
      2350
      250
      700
